import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import PaginaPrincipal from './PaginaPrincipal';
import Chatbot from './Chatbot';
import Donaciones from './Donaciones';
import IniciarSecion from './IniciarSesion';
import RegistroCoder from './RegistroCoder';
import RegistroCrafter from './RegistroCrafter';
import SubirReto from './SubirReto';
import './App.css'; // Importa el CSS global

function App() {
  return (
    <Router>
      <div className="app">
        <header className="app-header">
        </header>

        <main>
          <Routes>
            <Route path="/" element={<PaginaPrincipal />} />
            <Route path="/chatbot" element={<Chatbot />} />
            <Route path="/donaciones" element={<Donaciones />} />
            <Route path="/iniciarsecion" element={<IniciarSecion />} />
            <Route path="/registrocoder" element={<RegistroCoder />} />
            <Route path="/registrocrafter" element={<RegistroCrafter />} />
            <Route path="/subirreto" element={<SubirReto />} />
          </Routes>
        </main>

        <footer className="app-footer">
          <p>Â© TimeData2024 </p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
